			["disjunctive"] = "any",
			["displayText"] = "%c",
			["customText"] = "function()\n    local compTime = GetTime()\n    if aura_env.time ~= nil then      \n        for index, value in pairs(aura_env.time) do\n            if (value + 12) < compTime then\n                aura_env.time[index] = nil\n                aura_env.count = aura_env.count - 1               \n            end\n        end\n    end\n    WA_OOMM_IMP_COUNT = aura_env.count\n    return aura_env.count or 0\nend\n\n\n\n",
