				["use_spellName"] = true,
				["custom"] = "function(event, ...)\n    \n    local t = GetTime()\n    \n    --if the players attack speed changes, store it\n    if event == \"UNIT_ATTACK_SPEED\" then  \n        \n        if ... == \"player\" then \n            aura_env.attackSpeed = UnitAttackSpeed(\"player\")\n            if aura_env.debug then\n                print(\"player attack speed changed\")\n            end\n        end        \n        \n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        \n        local subevent = select(2, ...)\n        local destGUID = select(8, ...)\n        local sourceGUID = select(4, ...)\n        \n        --when the player hits, update swing timers\n        if subevent == \"SWING_DAMAGE\" and sourceGUID == aura_env.player then\n            \n            aura_env.lastSwing = t\n            aura_env.nextSwing = t + aura_env.attackSpeed\n            aura_env.swingTimer = aura_env.attackSpeed\n            if aura_env.debug then\n                print(\"player hit, reset swing timer\")\n            end\n            \n            --if the player parries, check for parry haste\n        elseif destGUID == aura_env.player and (subevent == \"SWING_MISSED\" and select(12, ...) == \"PARRY\" or subevent == \"SPELL_MISSED\" and select(15, ...) == \"PARRY\") then\n            \n            --[[\na) If the next swing is scheduled to occur in more than 60% of the player's swing speed, the scheduling will be shortened by 40% of the player's swing speed. \nb) If the next swing is scheduled to occur within 60% and 20% of the player's swing speed, the next swing will be re-scheduled to occur in 20% of the player's swing speed. \nc) If the next swing is scheduled to occur in less than 20% of the swing speed, the scheduling is unchanged.\n]]\n            \n            local timeLeft = aura_env.nextSwing - t\n            if aura_env.debug then\n                print(\"player parried, time left: \"..timeLeft)\n            end\n            \n            if timeLeft > 0.6 * aura_env.attackSpeed then\n                \n                aura_env.swingTimer = aura_env.swingTimer - 0.4 * aura_env.attackSpeed\n                aura_env.nextSwing = aura_env.nextSwing - 0.4 * aura_env.attackSpeed\n                if aura_env.debug then\n                    print(\"parry haste type a\")\n                end\n                \n            elseif timeLeft > 0.2 * aura_env.attackSpeed then\n                \n                local oldSchedule = aura_env.nextSwing\n                aura_env.nextSwing = t + 0.2 * aura_env.attackSpeed\n                aura_env.swingTimer = aura_env.swingTimer - (oldSchedule - aura_env.nextSwing)\n                if aura_env.debug then\n                    print(\"parry haste type b\")\n                end                    \n                \n            else\n                \n                if aura_env.debug then\n                    print(\"parry haste type c\")\n                end\n                \n            end\n            \n        end\n        \n    end\n    \n    return false\n    \nend\n\n",
