						["custom"] = "function()\n    \n    local t = GetTime()\n    local e = aura_env\n    \n    --check if we passed GCD time and store it as last GCD\n    if e.GCD and t > e.GCD then\n        e.lastGCD = e.GCD\n        e.GCD = nil\n        if e.debug then\n            print(\"old GCD stored\")\n        end\n    end \n    \n    --see if there currently is a GCD and store it\n    local start, duration = GetSpellCooldown(61304)\n    if start and duration and start > 0 and duration > 0 then\n        local GCD = start + duration\n        if GCD ~= e.GCD then\n            e.GCD = GCD\n            if e.debug then\n                print(\"new GCD set\")\n            end\n        end\n    else\n        e.GCD = nil\n    end\n    \n    --see if shield slam is on cd\n    local start, duration = GetSpellCooldown(23922)\n    if start and duration and start > 0 and duration > 0 then\n        local SS = start + duration\n        if SS ~= e.SS then\n            e.SS = SS\n            if e.debug then\n                print(\"new SS set\")\n            end\n        end\n    else\n        e.SS = nil\n    end\n    \n    \n    \n    local fullGCD = 1.5 / (1 + GetHaste() / 100)\n    local timeBefore = fullGCD * e.timeBefore\n    local timeAfter = fullGCD * e.timeAfter\n    \n    --trigger logic\n    --SS is on cd longer than the GCD\n    if e.SS and e.GCD and e.SS <= e.GCD then\n        e.hold = false\n        \n        --1st case: AA hits before the GCD\n    elseif e.GCD and e.nextSwing < e.GCD and e.nextSwing > e.GCD - timeBefore then\n        e.hold = true\n        if e.debug then\n            print(\"hold: aa before gcd\")\n        end\n        \n        --2nd case: AA hits after the GCD\n    elseif e.GCD and e.nextSwing > e.GCD and e.nextSwing < e.GCD + timeAfter then\n        e.hold = true\n        if e.debug then\n            print(\"hold: aa after gcd\")\n        end\n    elseif e.lastGCD and e.nextSwing > e.lastGCD and e.nextSwing < e.lastGCD + timeAfter then\n        e.hold = true\n        if e.debug then\n            print(\"hold: aa after gcd2\")\n        end\n        \n        --fallback\n    else\n        e.hold = false\n    end\n    \n    if e.showHoldOnly then\n        return e.hold\n    end\n    return true\nend\n\n",
