					["colorFunc"] = "function(progress, r1, g1, b1, a1, r2, g2, b2, a2)\n    local r,g,b = WeakAuras.regions[aura_env.id].region.icon:GetVertexColor()\n    if r > 0.95 then progress = progress*3 end\n    local delta = -0.2\n    local angle = (progress * 2 * math.pi) - (math.pi / 2)\n    local a = 1+(((math.sin(angle) + 1)/2) * delta)\n    if not aura_env.up then \n        if aura_env.cd then\n            a =0.2\n        else\n            a = 1\n        end\n    end\n    return r,g,b,a\nend\n\n\n\n\n\n\n\n\n\n\n\n\n",
