		["NL: Darkglare"] = {
			["text2Point"] = "CENTER",
			["text1FontSize"] = 14,
			["disjunctive"] = "all",
			["customText"] = "function(...)\n    local endtime,_,p = ...\n    local text = aura_env.Update(endtime,p)\n    return text or \"\"\nend",
			["untrigger"] = {
				["showOn"] = "showAlways",
				["spellName"] = 205180,
			},
			["anchorPoint"] = "CENTER",
			["activeTriggerMode"] = -10,
			["customTextUpdate"] = "update",
			["actions"] = {
				["start"] = {
