				},
				["main"] = {
					["colorR"] = 1,
					["duration"] = "1",
					["alphaType"] = "custom",
					["colorA"] = 1,
					["colorG"] = 1,
					["alphaFunc"] = "",
					["use_alpha"] = false,
					["type"] = "none",
					["use_color"] = true,
					["alpha"] = 1,
					["duration_type"] = "seconds",
					["y"] = 0,
					["colorType"] = "custom",
					["scaley"] = 1,
